Roy 'Chubby' Brown [born Royston Vasey, 3 February 1945]
is an English stand-up comedian, famous for his sarcastic 
blue humour. The controversial nature of his act means he 
rarely appears on major television channels, and Brown 
has attracted accusations that his comedy style is outdated 
whilst also being described as &quot;the most important comedian 
of the past 25 years&quot;

